INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24015, 4, 0.0, 1, 24, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 4);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24016, 1, 4.0, 2, 24, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 4);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24017, 4, 0.0, 3, 24, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 4);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24018, 2, 5.2, 4, 24, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24019, 6, 4.2, 5, 24, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 5);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24020, 2, 0.0, 6, 24, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 2);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24021, 6, 6.4, 7, 24, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24022, 2, 0.0, 8, 24, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 2);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24023, 3, 10.08, 9, 24, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 6);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24024, 2, 5.0, 10, 24, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24025, 2, 0.0, 11, 24, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 0.0, 110501, 10021, "2030/12/17 14:59:59", 0.0, 2);
